import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import { fetchWeatherData } from './Actions';

const Home2 = (props: any) => {
  useEffect(() => {
    props.fetchWeatherData();
  }, []);
  console.log("Corre")
  const { humidity, temperature, windSpeed } = props.weatherData;

  return (
    <div>
      <p>Humedad: {humidity}%</p>
      <p>Temperatura: {temperature}°F</p>
      <p>Velocidad del viento: {windSpeed} mph</p>
    </div>
  );
};

const mapStateToProps = (state:any) => {
  return {
    weatherData: state.weatherData,
  };
};

const mapDispatchToProps = (dispatch: any) => {
  return bindActionCreators({ fetchWeatherData }, dispatch);
};

export default connect(mapStateToProps, mapDispatchToProps)(Home2);
